#paste tooltips together separated by <br>
generateNiceTooltips = function(dataset) {
  myNames = names(dataset)
  LMN = length(myNames)
  s = 1;
  if (LMN > 2) s = 3

  nms = myNames[s:LMN]
  dta = dataset[, s:LMN]
