  for (n in c(1:length(nms))) {
    if (length(nms) == 1)
      niceTooltips = paste(nms, " = ", dta, sep = "")
    else {
      niceTooltips = paste(niceTooltips, nms[n], " = ", dta[, n], sep = "")
