if (validToPlot) # check packages
{
  si = sessionInfo()
  namesPackages = c(names(si$otherPkgs), names(si$basePkgs), names(si$loadedOnly))
  checkPackages = c("XML", "plotly", "ggplot2", "htmlwidgets", "scales")
  flagAllPackages = prod(checkPackages %in% namesPackages)

  if (!flagAllPackages)
    warning("*** Some of the packages are missing ! ***")
}

############# Main code #####################

if (validToPlot) {
  # Load the data using the Visual dataRoles
  # population is the base - number of cases
  # occurrence is the measure being rated as percent of population
  # state is the grouping of the scattered points - for color legend
  # hospital is the points being scattered
  dataset = cbind(population, occurrence, state, hospital)

  dataset = dataset[validData,] # keep only valid
  colnames(dataset) <- c("Cases", "Rate", "State", "Hospital")

  # for axes and hovertext labels
  lblCases = "Cases"
  lblRate = "Rate (%)"
  lblState = "State"
  lblHospital = "Hospital"

  countValue = dataset[, 1]
  p = dataset[, 2] / dataset[, 1]
  p.se <- sqrt((p * (1 - p)) / (countValue))
  df <- data.frame(p, countValue, p.se)

  mult = 1
  if (axisXisPercentage) {
    mult = 100
  }

  ## common effect (fixed effect model)
  p.fem <- weighted.mean(sum(dataset[, 2])/sum(dataset[, 1])) * mult

  ## lower and upper limits, based on FEM estimator
  zLow = qnorm(conf1)
  zUp = qnorm(conf2)

  number.seq <- dataset[, 1]

  totalCases = sum(number.seq)

  target_sd = sqrt((p.fem*0.9955)-(p.fem/totalCases))*10 

  number.llconf1 <- p.fem - zLow * target_sd/sqrt(number.seq) 
  number.ulconf1 <- p.fem + zLow * target_sd/sqrt(number.seq) 
  number.llconf2 <- p.fem - zUp * target_sd/sqrt(number.seq) 
  number.ulconf2 <- p.fem + zUp * target_sd/sqrt(number.seq) 

  if (keepOutData) {
    exportDF = dataset
    exportDF$p = p * mult
    exportDF$llconf1 <- p.fem - zLow * target_sd/sqrt(number.seq)
    exportDF$ulconf1 <- p.fem + zLow * target_sd/sqrt(number.seq)
    exportDF$llconf2 <- p.fem - zUp * target_sd/sqrt(number.seq)
    exportDF$ulconf2 <-  p.fem + zUp * target_sd/sqrt(number.seq)
  }

  yAxis = round(p * mult, digits = 2)

  #clean up yAxis data
  yAxis[yAxis==""] = 0
  yAxis[is.na(yAxis)] = 0
  yAxis[is.null(yAxis)] = 0

  p.fem[is.na(p.fem)] = 0
  p.fem[is.null(p.fem)] = 0

  #tweak the limits of the y-axis
  limsY = NiceLimitsAxis(axisData = yAxis, baseline = p.fem)

  dfCI <- data.frame(number.llconf1, number.ulconf1, number.llconf2, number.ulconf2, number.seq, p.fem)

  # Axes labels
  xLabText = cutStr2Show(lblCases, strCex = sizeLabel / 6, isH = TRUE, partAvailable = 0.85)
  yLabText = cutStr2Show(lblRate, strCex = sizeLabel / 6, isH = FALSE, partAvailable = 0.85)

  ## draw plot
  drawPoints = SparsifyScatter(dataset, minMaxPoints = c(Inf, Inf))

  df <- cbind(dataset,df)

  df[,2] <- yAxis 

  names(yAxis[drawPoints]) <- "Rate"

  fp <- ggplot(aes(x = Cases, y = Rate), data = df[drawPoints,])

  # text property contains the hovertext for scatter points
  fp <- fp + geom_point(aes(col = State, text = paste(lblState,": ",State,"<br>",lblHospital,": ",Hospital,"<br>",lblCases,": ",Cases,"<br>",lblRate,": ",format(round(as.numeric(Rate),1), nsmall=1), sep = "")), alpha = transparency, shape = 19, size = pointCex * 2)

  fp <- fp + geom_line(aes(x = number.seq, y = number.llconf1), linetype = 1, colour = "#81A5BE", data = dfCI)
  fp <- fp + geom_line(aes(x = number.seq, y = number.ulconf1), linetype = 1, colour = "#81A5BE", data = dfCI)

  fp <- fp + geom_line(aes(x = number.seq, y = number.llconf2), linetype = 2, colour = "#1D588B", data = dfCI)
  fp <- fp + geom_line(aes(x = number.seq, y = number.ulconf2), linetype = 2, colour = "#1D588B", data = dfCI)

  fp <- fp + geom_hline(aes(yintercept = p.fem), data = dfCI, colour = lineColor, linetype = 4) #baseline

  fp <- fp + scale_color_discrete(name = "State")

  if (scaleYformat %in% c("none"))
    fp <- fp + scale_y_continuous(limits = limsY)

  if (scaleYformat %in% c("comma"))
    fp <- fp + scale_y_continuous(limits = limsY, labels = comma)

  if (scaleYformat %in% c("scientific"))
    fp <- fp + scale_y_continuous(limits = limsY, labels = scientific)

  if (scaleXformat %in% c("comma"))
    fp <- fp + scale_x_continuous(labels = comma)

  if (scaleXformat %in% c("dollar"))
    fp <- fp + scale_x_continuous(labels = dollar)

  if (scaleXformat %in% c("scientific"))
    fp <- fp + scale_x_continuous(labels = scientific)

  fp <- fp + xlab(xLabText) + ylab(yLabText) + theme_bw()

  if (verticalPlot)
    fp <- fp + coord_flip()

} else {
  # empty plot 
  fp <- ggplot()
}

#add warning as title
